        return new Twig_Source("{% block _an_images_widget %}
    <p>Ici, vous pouvez modifier, ajouter ou supprimer vos images</p>
    {{ form_widget(form) }}
    <div class=\"form-button\">
    
    <button type=\"button\" id=\"add-image\" class=\"btn btn-primary\">
    <i class=\"fas fa-plus\"></i>
    Ajouter une image
    </button>
    </div>
{% endblock %}

{% block _an_images_entry_row %}
    {{ form_widget(form) }}
{% endblock %}

{% block _an_images_entry_widget %}
    <div class=\"form-group\" id=\"block_{{id}}\">
        <div class=\"row\">
                <div class=\"col-10\">
                    <div class=\"row\">
                        <div class=\"col\">
                            {{ form_widget(form.url) }}
                            {{ form_errors(form.url) }}

                            
                        </div>
                        <div class=\"col\">
                            {{ form_widget(form.caption) }}
                            {{ form_errors(form.caption) }}
                        </div>
                    </div>
                </div>
                <div class=\"col-2\">
                <button type=\"button\" data-action=\"delete\" data-target=\"#block_{{id}}\" class=\"btn btn-danger\">X</button>
                </div>
        </div>
    </div>
{% endblock %}
